const theme = {
  colors: {
    background: '#f5f5f5',     // Light Gray (background)
    text: '#333333',           // Charcoal Gray (text)
    primary: '#48284A',        // Electric Blue (primary)
    secondary: '#ff6b6b',      // Hot Pink (secondary)
    accent: '#f1c40f',         // Sunflower Yellow (accent)
    highlight: '#2ecc71',      // Mint Green (highlight)
  },
};

export default theme;
